class RoadContent {
    constructor(array) {
        if(array)
        {
            this.array = array;
        }
        else
        {
            this.array = [];
            for(let i= 0; i < 10; i++){
                this.array[i] = Math.floor(Math.random() * 3);
            }
        }
    }

    get content(){
        return this.array
    }

    move(){
        this.array.shift();
        this.array[this.array.length] = Math.floor(Math.random() * 3);
    }

}
export default new RoadContent()
